if(window.templates === void 0)window.templates = Object.create(null)
window.templates['Blackprint/page.html'] = '<sf-space blackprint>\n  <!-- Put the cables behind the nodes -->\n  <sf-m name="cables" class="cables" id="test">\n    <svg style="transform: translate(-{{space[0]}}, -{{space[1]}}px)">\n      <g sf-repeat-this="x in list" class="{{ x.type }} {{ x.valid ? \'\' : \'invalid\' }}">\n        <path\n            d="M {{ recalculatePath(x) || x.head1[0] + \' \' + x.head1[1] }}\n               C {{ x.linePath }},\n                 {{ recalculatePath(x) || x.head2[0] + \' \' + x.head2[1] }}"\n        ></path>\n        <circle\n            @pointerdown="cableHeadClicked(x, event)"\n            transform="translate({{x.head2[0]}}, {{x.head2[1]}})"\n        ></circle>\n      </g>\n    </svg>\n  </sf-m>\n\n  <!-- Nodes goes here -->\n  <sf-m name="nodes" class="nodes" style="user-select:none;">\n    <!-- Handled on ./nodes.js -->\n    <div sf-repeat-this="item in list">\n      {{@exec\n        var node;\n\n        if(item.type === \'default\')\n          node = $DefaultNode;\n        else{\n          console.error(item, "type not found");\n          @return null;\n        }\n\n        // Create from Blackprint\'s namespace and (true = let the item become the scope)\n        @return new node(item, Blackprint.space, true); \n      }}\n    </div>\n  </sf-m>\n</sf-space>'
window.templates['Blackprint/nodes/default.html'] = '<default-node class="node general" style="transform: translate({{ x }}px, {{ y }}px)">\n  <div class="title" @dragmove="moveNode(event)">{{ title }} <div class="description">{{ description }}</div></div>\n\n  <div style="display: flow-root;margin-top: 5px;">\n    <!-- Container for input -->\n    <div class="input">\n      <div class="ports {{ x.type.name }}" sf-repeat-this="x in inputs">\n        <div class="port"\n            @pointerdown="createCable(event, x)"\n            @pointerup="cableConnect(x)"\n            @pointerover="portHovered(event, x)"\n            @pointerout="portUnhovered"\n        ></div>\n        <div class="name">{{ x.name }}</div>\n      </div>\n    </div>\n\n    <!-- Container for output -->\n    <div class="output">\n      <div class="ports {{ x.type.name }}" sf-repeat-this="x in outputs">\n        <div class="name">{{ x.name }}</div>\n        <div class="port"\n            @pointerdown="createCable(event, x)"\n            @pointerup="cableConnect(x)"\n            @pointerover="portHovered(event, x)"\n            @pointerout="portUnhovered"\n        ></div>\n      </div>\n    </div>\n  </div>\n\n  <!-- Container for property -->\n  <div class="property">\n    <div class="ports {{ x.type.name }}" sf-repeat-this="x in properties">\n      <div class="name">{{ x.name }}</div>\n      <div class="port"\n          @pointerdown="createCable(event, x)"\n          @pointerup="cableConnect(x)"\n          @pointerover="portHovered(event, x)"\n          @pointerout="portUnhovered"\n      ></div>\n    </div>\n  </div>\n</default-node>'
window.templates['Blackprint/nodes/logger.html'] = '<logger-node class="node general" style="transform: translate({{ x }}px, {{ y }}px)">\n  <div class="title" @dragmove="moveNode">{{ title }} <div class="description">{{ description }}</div></div>\n\n  <div style="display: flow-root;margin-top: 5px;">\n    <textarea value=""></textarea>\n\n    <!-- Container for input -->\n    <div class="input">\n      <div class="ports {{ x.type.name }}" sf-repeat-this="x in inputs">\n        <div class="port"\n            @pointerdown="createCable(event, x)"\n            @pointerup="cableConnect(x)"\n            @pointerover="portHovered(event, x)"\n            @pointerout="portUnhovered"\n        ></div>\n        <div class="name">{{ x.name }}</div>\n      </div>\n    </div>\n  </div>\n</logger-node>'